import react, { useState, useEffect } from "react";
import {
  Table,
  TableHead,
  TableCell,
  Paper,
  TableRow,
  TableBody,
  Button,
  styled,
} from "@mui/material";
import { getUsers, deleteUser } from "../../Service/api";
import { Link } from "react-router-dom";
import Card from "@mui/material/Card";
import CardActions from "@mui/material/CardActions";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import Typography from "@mui/material/Typography";
import ResourceCard from "../ResourceCard/ResourceCard";
import styles from "../ResourceCard/ResourceCard.module.css";
import axios from "axios";
const StyledTable = styled(Table)`
  width: 90%;
  margin: 50px 0 0 50px;
`;

const THead = styled(TableRow)`
  & > th {
    font-size: 20px;
    background: #000000;
    color: #ffffff;
  }
`;

const TRow = styled(TableRow)`
  & > td {
    font-size: 18px;
  }
`;

const AllUsers = () => {
  const [users, setUsers] = useState([]);
  const [imagesLink, setImagesLinks] = useState([]);
  useEffect(() => {
    getAllUsers();
    getImages();
  }, []);

  const deleteUserData = async (id) => {
    await deleteUser(id);
    getAllUsers();
  };

  const getAllUsers = async () => {
    console.log("getAllUsers");
    let response = await getUsers();
    // console.log("getAllUsers response ", response);

    setUsers(response.data);
  };
  const URL =
    "https://api.unsplash.com/search/photos?page=1&query=office&client_id=L1-B1K0i6IQSGC4v7KNQmDCovA-KOgHWJZjUTodM_mY";
  const getImages = async () => {
    const response = await axios.get(URL);
    setImagesLinks(response);
    console.log("getImages", response.data);
  };
  // console.log("response", response);
  // return response.data;
  // };
  return (
    <>
      <div className="ResourceCardsWrapper">
        {users.map((room) => (
          <div className="ResourceCard">
            <ResourceCard />
          </div>
        ))}
      </div>
    </>
  );
};

export default AllUsers;
